import React from "react";

function Jumbotron({ children }) {
  return (
    <div
      style={{ color: "white",height: 300, clear: "both", paddingTop: 120, textAlign: "center", backgroundImage: "url(" + "https://www.listchallenges.com/f/lists/5cbf2a33-a7b5-4a10-8661-315721054e6a.jpg" + ")"}}
      className="jumbotron"
    >
      {children}
    </div>
  );
}

export default Jumbotron;
